Iris (1987) John Kraaykamp



 Nederland
Thriller
90 minuten

geregisseerd door Mady Saks
met Monique van de Ven, John Kraaykamp en Titus Tiel Groenestege

Een vrouwelijk veearts (Monique van de Ven) moet veel vooroordelen overwinnen voordat zij door een plattelandsgemeenschap wordt geaccepteerd. Met name de relatie die zij aangaat met de zoon van een invloedrijke herenboer wordt haar niet in dank afgenomen; niet door de bekrompen boerengemeenschap, maar ook niet door haar ex-vriend uit de stad.

English

Storyline
When Iris moves to the country to start a veterinary practice, she finds a lot of skeptical villagers as well as disapproval from her city bound boyfriend. 




